import React from 'react'
import { BsCreditCard2Front } from 'react-icons/bs';

const Notes = ({ notes }) => {

    return (
        <div className="right-side-notes flex-grow-1">
            <div className="notes-box">
                <div>
                    <h5>Notesss</h5>
                    <h4>{notes.length}</h4>
                </div>
                <div>
                    <BsCreditCard2Front />
                </div>
            </div>
        </div>
    )
}

export default Notes


